import "./App.css";
import {  Navigate, Route, Routes } from "react-router-dom";
// import Landing from "./components/layout/Landing";
import Auth from "./views/Auth";
import LoginForm from "./components/auth/LoginForm";

function App() {
  return (
    <Routes>
      <Route path="/" element={<Navigate to="/login" replace />} />
      <Route
        path="/login"
        // children={(props) => <Auth {...props} authRoute="login" />}
        children={<Auth authRoute="login" />}
        // element={<LoginForm/>}
      />
      <Route
        path="/register"
        children={(props) => <Auth {...props} authRoute="register" />}
      />
    </Routes>
  );
}

export default App;
